//! Pools 
CoA=-AcCoA+Pool[1];// for CoA+AcCoA 
//! Rate laws 
//i_isl=P[1]; 
//i_ms=P[2]; 
V[1]=Vm_1*(OA*AcCoA-ICit*CoA/Keq_1)/(Km_OA_1+OA+(Km_OA_1/Km_ICit_1)*ICit); 
V[2]=(1-i_icl/100)*Vm_2*(ICit-Suc*GlOx/Keq_2)/(Km_ICit_2+ICit)/(1+Suc/Ki_Suc_2)/(1+Mal/Ki_Mal_2); 
V[3]=(1-i_ms/100)*Vm_3*(GlOx*AcCoA-Mal*CoA/Keq_3)/(Km_GlOx_3+GlOx+(Km_GlOx_3/Km_Mal_3)*Mal); 
V[4]=Vm_4*(Mal*NAD-OA*NADH/Keq_4)/(Km_Mal_4+Mal+(Km_Mal_4/Km_OA_4)*OA); 
V[5]=Vm_5*ICit*NADP/(Km_ICit_5+ICit)/(1+GlOx/Ki_GlOx_5)/(1+OA/Ki_OA_5); 
V[6]=k6*CoA; 
V[7]=Vm_7*(Suc-Mal/Keq_7)/(Km_Suc_7+Suc+(Km_Suc_7/Km_Mal_7)*Mal); 
V[8]=k8*Suc; 
//! Differential equations 
//for ICit 
F[1]=V[1]-V[2]-V[5]; 
//for GlOx 
F[2]=V[2]-V[3]; 
//for Mal 
F[3]=V[3]-V[4]+V[7]; 
//for OA 
F[4]=-V[1]+V[4]; 
//for Suc 
F[5]=V[2]-V[7]-V[8]; 
//for AcCoA 
F[6]=-V[1]-V[3]+V[6]; 
//for CoA 
F[7]=V[1]+V[3]-V[6]; 
//! Explicit functions

